import { MDBCol, MDBContainer, MDBRow } from 'mdbreact'
import React, { Component } from 'react'

export default class About extends Component {
    render() {
        return (
            <div>
              <div className="about-us">
                  <MDBContainer>
                      <MDBRow>
                          <MDBCol md="12"></MDBCol>
                      </MDBRow>
                  </MDBContainer>
              </div>
            </div>
        )
    }
}
